import React, { Component, Fragment } from "react";
import styled from "styled-components";
import AOS from "aos";
import "aos/dist/aos.css";
import { TextField } from "@mui/material";
import { Formik } from 'formik';

const MainHeading = styled.h1`
font-size: 4vw;
color:#d2d2d2;
#2c3d65font-family:Pixel;
text-align:center;
font-weight:bolder;
overflow:hidden

@media (min-width: 1px) and (max-width: 426px) {
  font-size: 10vw;

   }
`;

const Container = styled.div`
padding: 40px;
`;

const Btn = styled.button`
padding: 40px;
`;

const Form = styled.div`
padding: 20px;
    display: flex;
    flex-direction: column;
    background: white;
    border-radius: 10px;
    margin: 60px;
margin-bottom: 0px;
width: calc(100% / 2);
`;


const Input = styled(TextField)`

margin: 10px;
width: calc(100% / 2);
`;

const MainHeadingContainer = styled.div`
  overflow: hidden;

  @media (min-width: 1px) and (max-width: 426px) {
  }
`;

const Contact = () => {
  return (
    <Container>
      <MainHeadingContainer>
        <MainHeading data-aos="slide-up">CONTACT ME</MainHeading>
      </MainHeadingContainer>

      <Formik
       initialValues={{ email: '', password: '' }}
       validate={values => {
         const errors = {};
         if (!values.email) {
           errors.email = 'Required';
         } else if (
           !/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(values.email)
         ) {
           errors.email = 'Invalid email address';
         }
         return errors;
       }}
       onSubmit={(values, { setSubmitting }) => {
         setTimeout(() => {
           alert(JSON.stringify(values, null, 2));
           setSubmitting(false);
         }, 400);
       }}
     >
       {({
         values,
         errors,
         touched,
         handleChange,
         handleBlur,
         handleSubmit,
         isSubmitting,
         /* and other goodies */
       }) => (
         <Form onSubmit={handleSubmit}>
             <Input id="outlined-basic"     name="email" label="Name" variant="outlined"  onChange={handleChange}         onBlur={handleBlur}/>

      <Input id="outlined-basic"     name="email" label="Surname" variant="outlined"  onChange={handleChange}         onBlur={handleBlur}/>

           <Btn type="submit" disabled={isSubmitting}>
             Submit
           </Btn>
         </Form>
       )}
     </Formik>

    </Container>
  );
};

export default Contact;
